/** 
 * Moves a queue item at the source index to the target index. <p> If the item being moved is the currently playing, then the current playing index is set to that of the target. If the moved item is not the currently playing and moves to an index <b>AFTER</b> the current playing index, then the current playing index is decremented. Vice versa if the an item after the currently playing is moved <b>BEFORE</b>. </p>
 * @param source the original index of the item
 * @param target the new index of the item
 */
public synchronized void move(final int source,final int target){
  if (source < 0 || target < 0) {
    return;
  }
  if (source >= streams.size() || target >= streams.size()) {
    return;
  }
  final int current=getIndex();
  if (source == current) {
    queueIndex.set(target);
  }
 else   if (source < current && target >= current) {
    queueIndex.decrementAndGet();
  }
 else   if (source > current && target <= current) {
    queueIndex.incrementAndGet();
  }
  final PlayQueueItem playQueueItem=streams.remove(source);
  playQueueItem.setAutoQueued(false);
  streams.add(target,playQueueItem);
  broadcast(new MoveEvent(source,target));
}
